@NOELreports I keep all fingers crossed for Ukraine.

But such carnage among the Russians is not at all pleasant. There are quite a few among them who simply had no choice and are not rapists either. Damn it. 

I really hope the number of prisoners will exceed that of the dead.

@DancehallHeat I heard about 18K to 22K still on the left side of Dnipro. They tought Ukraine would just let them go?
They should have surrendered - WFT 😬
Any footage of the situation?

@firejack007 Poor guys.
Like for the Irakian army at his time, it still sad to ear about this kind of tragedy.

But despite this, russian MUST leave Ukraine. The faster they will do it, the better it will be for both sides.
